import { Routes, Route, useLocation, Navigate } from 'react-router-dom';
import Home from './pages/Home';
import SignIn from './pages/SignIn';
import SignUp from './pages/SignUp';
import Dashboard from './pages/Dashboard';
import UserProfile from './pages/UserProfile';
import RoommateSearch from './pages/RoommateSearch';
import BuildingSearch from './pages/BuildingSearch';
import Navbar from './components/Navbar';
import { useAuth } from './context/AuthContext';
import UserOnboarding from './pages/UserOnboarding';

// Protected Route Component
const ProtectedRoute = ({ children }) => {
  const { isAuthenticated, user } = useAuth();

  if (!isAuthenticated) {
    return <Navigate to="/signin" />;
  }

  // Redirect to onboarding if user hasn't completed it
  if (!user?.hasCompletedOnboarding) {
    return <Navigate to="/onboarding" />;
  }

  return children;
};

// Onboarding Route Component
const OnboardingRoute = ({ children }) => {
  const { isAuthenticated, user } = useAuth();

  if (!isAuthenticated) {
    return <Navigate to="/signin" />;
  }

  // If user has already completed onboarding, redirect to dashboard
  if (user?.hasCompletedOnboarding) {
    return <Navigate to="/dashboard" />;
  }

  return children;
};

function App() {
  const { isAuthenticated } = useAuth();
  const location = useLocation();

  const showNavbar = location.pathname === '/' || location.pathname === '/home';

  return (
    <div className="min-h-screen">
      {showNavbar && <Navbar />}
      <Routes>
        {/* Public routes */}
        <Route path="/" element={<Home />} />
        <Route path="/home" element={<Home />} />
        <Route path="/signin" element={
          isAuthenticated ? <Navigate to="/dashboard" /> : <SignIn />
        } />
        <Route path="/signup" element={<SignUp />} />

        {/* Onboarding route */}
        <Route path="/onboarding" element={
          <OnboardingRoute>
            <UserOnboarding />
          </OnboardingRoute>
        } />

        {/* Protected routes */}
        <Route path="/dashboard" element={
          <ProtectedRoute>
            <Dashboard />
          </ProtectedRoute>
        } />
        <Route path="/profile" element={
          <ProtectedRoute>
            <UserProfile />
          </ProtectedRoute>
        } />
        <Route path="/roommate-search" element={
          <ProtectedRoute>
            <RoommateSearch />
          </ProtectedRoute>
        } />
        <Route path="/building-search" element={
          <ProtectedRoute>
            <BuildingSearch />
          </ProtectedRoute>
        } />
      </Routes>
    </div>
  );
}

export default App;
